import React from "react";

const Projects = () => (
    <section id="Projects">
        <h2>My Projects</h2>
        <ul>
            <li>Project1 - Calculator</li>
            <li>Project2 - Login page</li>
            <li>Project3 - Portfolio</li>
            
        </ul>
    </section>
);

export default Projects;
